import {
    Container
} from './styles'

import Logo from '../../assets/logo.png'
import Login from '../../assets/login.png'


const Main_navbar = () => {

    return (
        <Container>
                <img src={Logo}></img>
                <a href="#" > Cardápio </a>
                <a href="#" > Promoções </a>
                <a href="#" > Contato</a>
                <img src={Login}></img>
        </Container>


    );
}

export default Main_navbar;
